import { OpenAPIRoute, OpenAPIRouteSchema } from "@cloudflare/itty-router-openapi";
import { fetchLatestDoubleBattlePokemonRanking } from './rankMatchFetcher';

export interface Env {
  POKEMON_DATA: KVNamespace;
}


export class PokeData extends OpenAPIRoute {
  static schema: OpenAPIRouteSchema = {
    tags: ["Pokemon"],
    summary: "Get Pokemon Base Stats",
    responses: {
      "200": {
        description: "Successful response",
        schema: {
          type: "array",
          items: {
            type: "object",
            properties: {
              id: { type: "number" },
              name: { type: "string" },
              types: {
                type: "array",
                items: { type: "string" }
              },
              base_stat: {
                type: "object",
                properties: {
                  HP: { type: "string" },
                  攻撃: { type: "string" },
                  防御: { type: "string" },
                  特攻: { type: "string" },
                  特防: { type: "string" },
                  素早: { type: "string" },
                  合計: { type: "string" }
                }
              }
            }
          }
        }
      },
    }
  };

  async handle(request: Request, env: Env) {
    const pokemonBaseStat = await env.POKEMON_DATA.get("BASE_STAT");
    const poke = await fetchLatestDoubleBattlePokemonRanking()
    const data = poke.map(p => buildPokeData(p['id'], p['form'],pokemonBaseStat));

    return new Response(JSON.stringify(data), {
      headers: { 'Content-Type': 'application/json' }
    });
  }
}

  function buildPokeData(id, form, csv_base_stat) {
    const parsedId = parseInt(id, 10);
    const parsedForm = parseInt(form, 10);

    const name = poke_names[parsedId - 1];
    const typeIndexes = poke_type_map[parsedId][parsedForm];
    const types = typeIndexes.map(index => poke_types[index]);
    const baseStat = PokemonBaseStats(parsedId, parsedForm, csv_base_stat);

    return {
      id: parsedId,
      name: name,
      types: types,
      base_stat: baseStat
    };
  }

  function PokemonBaseStats(id, form, csv_base_stat) {
    // CSVを解析する
    const rows = csv_base_stat.split('\n');
    const headers = rows[0].split(',');
    let baseStat = {};
  
    for (let i = 1; i < rows.length; i++) {
      const row = rows[i].split(',');
      const rowData = headers.reduce((obj, header, index) => {
        obj[header] = row[index];
        return obj;
      }, {});
  
      if (parseInt(rowData['No.']) === id && parseInt(rowData['form']) === form) {
        baseStat = {
          HP: rowData['HP'],
          攻撃: rowData['攻撃'],
          防御: rowData['防御'],
          特攻: rowData['特攻'],
          特防: rowData['特防'],
          素早: rowData['素早'],
          合計: rowData['合計']
        };
        break;
      }
    }
  
    return baseStat;
  }
  

